        <footer>
            <Container>
                <Row>
                    <Col>
                        <p className="text-muted d-none d-md-flex">RealtyStore.com is the fastest growing, most trusted and secure provider of Foreclosure Listings in the nation.<br></br>We value and respect your privacy. For details, please review our Privacy Policy by clicking below.</p>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
}

export default Footer;
